import React, {Component} from 'react'
import { NavBar, Icon, Popover, Menu, ActivityIndicator } from 'antd-mobile';
import { withRouter } from 'react-router-dom'
import './index.less'

class Nav extends Component {
	state = {
		visible: false,
		selected: '',
		initData: '',
		show: false,
	}
	onSelect = (opt) => {
		this.props.handleSelected(opt.props.value)
		this.setState({
			visible: false,
			selected: opt.props.value,
		});
		document.removeEventListener('touchmove', this.bodyScroll, {
			passive: false
		})
	};
	handleVisibleChange = (visible) => {
		if(visible) {
			document.addEventListener('touchmove', this.bodyScroll, {
				passive: false
			})
		} else {
			document.removeEventListener('touchmove', this.bodyScroll, {
				passive: false
			})
		}
		this.setState({
			visible,
		});
	};
	onChange = (value) => {
		if(value.length===1){
			this.props.setBlocks(value[0])
		}else{
			const menuId = value[value.length - 1]
			this.props.history.push(`/${menuId}`)
			document.removeEventListener('touchmove', this.bodyScroll, {
				passive: false
			})
		}
		this.setState({
			show: false,
		});
	}
	handleClick = (e) => {
		const {data} = this.props;
		e.preventDefault(); // Fix event propagation on Android
		this.setState({
			show: true,
		});
		document.addEventListener('touchmove', this.bodyScroll, {
			passive: false
		})
		if(!this.state.initData) {
			setTimeout(() => {
				this.setState({
					initData: data,
				});
			}, 500);
		}
	}
	onMaskClick = () => {
		this.setState({
			show: false,
		});
		document.removeEventListener('touchmove', this.bodyScroll, {
			passive: false
		})
	}
	bodyScroll = (e) => {
		e.preventDefault();
	}
	render() {
		const {title,pops,level,isDrawer,isUserpage} = this.props;
		const {initData,show,visible} = this.state
		const menu = (
			<Menu
              className="foo-menu"
              data={initData}
			  level={level}
              onChange={this.onChange}
            />
		);
		const loadingEl = (
			<div style={{ width: '100%', height: document.documentElement.clientHeight * 0.6, display: 'flex', justifyContent: 'center' }}>
            <ActivityIndicator size="large" />
        </div>
		);
		return(
			<div className={show ? 'menu-active' : ''}>
                <div className="my-nav">
                <NavBar
                    mode="dark"
                    leftContent={isUserpage?null:title==="HYDROCARBON"?"Blocks":isDrawer?"关闭":"菜单"}
					onLeftClick={isUserpage?null:isDrawer?this.props.shutRabcTem:this.handleClick}
                    rightContent={
                        <Popover mask
                            overlayClassName="fortest"
                            overlayStyle={{ color: 'currentColor' }}
                            visible={visible}
                            overlay={pops}
                            align={{
                            overflow: { adjustY: 0, adjustX: 0 },
                            offset: [-10, 0],
                            }}
                            onVisibleChange={this.handleVisibleChange}
                            onSelect={this.onSelect}
                        >
                            <div style={{
                                height: '100%',
                                padding: '0 15px',
                                marginRight: '-15px',
                                display: 'flex',
                                alignItems: 'center',
                                }}>
                            <Icon type="ellipsis" />
                            </div>
                        </Popover>
                        }>
                    {title}
                </NavBar>
                </div>
                {show ? initData ? menu : loadingEl : null}
                {show ? <div className="menu-mask" onClick={this.onMaskClick} /> : null}
            </div>
		)
	}
}
export default withRouter(Nav)
